#version 100

uniform 	vec4 hlslcc_mtx4x4unity_ObjectToWorld[4];
uniform 	vec4 hlslcc_mtx4x4unity_MatrixVP[4];
uniform 	mediump vec4 _RendererColor;
attribute highp vec3 in_POSITION0;
attribute highp vec4 in_TEXCOORD0;
attribute highp vec4 in_COLOR0;
varying highp vec3 vs_INTERP0;
varying highp vec4 vs_INTERP1;
varying highp vec4 vs_INTERP2;
vec3 u_xlat0;
vec4 u_xlat1;
void main()
{
    u_xlat0.xyz = in_POSITION0.yyy * hlslcc_mtx4x4unity_ObjectToWorld[1].xyz;
    u_xlat0.xyz = hlslcc_mtx4x4unity_ObjectToWorld[0].xyz * in_POSITION0.xxx + u_xlat0.xyz;
    u_xlat0.xyz = hlslcc_mtx4x4unity_ObjectToWorld[2].xyz * in_POSITION0.zzz + u_xlat0.xyz;
    u_xlat0.xyz = u_xlat0.xyz + hlslcc_mtx4x4unity_ObjectToWorld[3].xyz;
    u_xlat1 = u_xlat0.yyyy * hlslcc_mtx4x4unity_MatrixVP[1];
    u_xlat1 = hlslcc_mtx4x4unity_MatrixVP[0] * u_xlat0.xxxx + u_xlat1;
    u_xlat1 = hlslcc_mtx4x4unity_MatrixVP[2] * u_xlat0.zzzz + u_xlat1;
    vs_INTERP0.xyz = u_xlat0.xyz;
    gl_Position = u_xlat1 + hlslcc_mtx4x4unity_MatrixVP[3];
    vs_INTERP1 = in_TEXCOORD0;
    vs_INTERP2 = in_COLOR0 * _RendererColor;
    return;
}


#version 100

#ifdef GL_FRAGMENT_PRECISION_HIGH
    precision highp float;
#else
    precision mediump float;
#endif
precision highp int;
uniform 	vec4 hlslcc_mtx4x4unity_ObjectToWorld[4];
uniform 	vec4 _C1;
uniform 	float _FillAmount;
uniform 	vec4 _C2;
uniform 	vec4 _C3;
uniform 	vec4 _C4;
uniform 	float _SARM;
varying highp vec3 vs_INTERP0;
varying highp vec4 vs_INTERP2;
#define SV_TARGET0 gl_FragData[0]
vec4 u_xlat0;
bvec3 u_xlatb0;
vec4 u_xlat1;
vec3 u_xlat2;
vec3 u_xlat3;
bool u_xlatb3;
void main()
{
    u_xlat0.x = vs_INTERP0.y + (-hlslcc_mtx4x4unity_ObjectToWorld[3].y);
    u_xlat3.x = _FillAmount * 0.840000033 + -0.5;
    u_xlat3.x = u_xlat3.x * _SARM;
    u_xlatb3 = u_xlat3.x>=u_xlat0.x;
    if(!u_xlatb3){discard;}
    u_xlat1.w = u_xlatb3 ? 1.0 : float(0.0);
    u_xlat3.xyz = vec3(_SARM) * vec3(-0.289999992, -0.0799999982, 0.129999995);
    u_xlatb0.xyz = greaterThanEqual(u_xlat3.xyzx, u_xlat0.xxxx).xyz;
    u_xlat0.x = u_xlatb0.x ? float(1.0) : 0.0;
    u_xlat0.y = u_xlatb0.y ? float(1.0) : 0.0;
    u_xlat0.z = u_xlatb0.z ? float(1.0) : 0.0;
;
    u_xlat2.xyz = _C1.xyz + (-_C2.xyz);
    u_xlat2.xyz = u_xlat0.xxx * u_xlat2.xyz + _C2.xyz;
    u_xlat2.xyz = u_xlat2.xyz + (-_C3.xyz);
    u_xlat0.xyw = u_xlat0.yyy * u_xlat2.xyz + _C3.xyz;
    u_xlat0.xyw = u_xlat0.xyw + (-_C4.xyz);
    u_xlat1.xyz = u_xlat0.zzz * u_xlat0.xyw + _C4.xyz;
    u_xlat0 = u_xlat1 * vs_INTERP2;
    SV_TARGET0 = u_xlat0;
    return;
}
